import './App.css';
import React, {useContext} from "react";
import {Switch, Route, Redirect} from 'react-router-dom';
import InlogPage from "./Pages/Inlog/InlogPage";
import DashboardPage from "./Pages/Dashboard/DashboardPage";
import RegisterPage from "./Pages/Register/RegisterPage";
import FormPage from "./Pages/Form/formPage";
import Test from "./Pages/Test pagina/test";
import ThanksPage from "./Pages/Thanks/ThanksPage";
import Weather from "./Pages/Weather/Weather";
import InlogTest from "./Pages/Inlog-test/Inlog--test";
import {AuthContextTest} from "./context/AuthContext--test";



function App() {
  const { isAuth } = useContext(AuthContextTest)
  return (
<>
  <Switch>
    <Route exact path="/">
      {isAuth ? <DashboardPage/>: <Redirect to="/inlog-test"/>}
    </Route>
    <Route path="/inlog">
      <InlogPage/>
    </Route>
    <Route path="/registreer">
      <RegisterPage/>
    </Route>

    <Route path="/bestellijst">
           <FormPage/>
    </Route>

    <Route path="/test">
      <Test/>
    </Route>

    <Route path="/thanks">
      <ThanksPage/>
    </Route>

    <Route path="/weer">
      <Weather/>
    </Route>

    <Route path="/inlog-test">
      <InlogTest/>
    </Route>

  </Switch>




</>


  );
}

export default App;
